import React, { useState } from "react";
import Navbar from "../../components/Navbar";
import AdminPanel from "../../components/AdminPanel";
import { Link } from "react-router-dom";
import Footer from "../../components/Footer";

const AdminDashboard = () => {
  const [message, setMessage] = useState("Hello World");
  const [customers, setCustomers] = useState([{}]);
  const total_revenue = 1500.99;
  const available_fabric = 650;
  const average_service_time = {
    days: 7,
    hours: 24,
  };
  const invoice_data = [
    {
      total: 500,
      sum: 100,
    },
  ];
  return (
    <>
      <Navbar />
      <main className="p-[4rem]">
        <AdminPanel />
        <section className="admin-dashboard font-minimo-Medium">
          <h1 className="title">Admin Dashboard</h1>
          <p className="message">{message}</p>
          <div className="grid grid-cols-2 gap-[4rem] justify-center items-center w-[70vw] m-auto">
            <div className="text-center shadow-md shadow-[#555] p-[2rem] rounded-[1rem] flex flex-col gap-[1rem]">
              <h2 className="text-khamco-secondary text-2xl font-bold">
                Total Customers
              </h2>
              <h2>{customers.length}</h2>
              <Link to="/admin/customers_data" className="edit-btn">
                Details
              </Link>
            </div>
            <div className="text-center shadow-md shadow-[#555] p-[2rem] rounded-[1rem] flex flex-col gap-[1rem]">
              <h2 className="text-khamco-secondary text-2xl font-bold">
                Revenue Generated
              </h2>
              <h2 className="text-green-500">
                KWD {new Intl.NumberFormat("en-US").format(total_revenue)}
              </h2>
              <Link to="/admin/revenue" className="edit-btn">
                Details
              </Link>
            </div>
            <div className="text-center shadow-md shadow-[#555] p-[2rem] rounded-[1rem] flex flex-col gap-[1rem]">
              <h2 className="text-khamco-secondary text-2xl font-bold">
                Total Fabric
              </h2>
              <h2 className="text-green-500">{available_fabric} meters</h2>
              <Link to="/admin/fabrics" className="edit-btn">
                Details
              </Link>
            </div>
            <div className="text-center shadow-md shadow-[#555] p-[2rem] rounded-[1rem] flex flex-col gap-[1rem]">
              <h2 className="text-khamco-secondary text-2xl font-bold">
                Average Service Time
              </h2>
              <h2 className="text-green-500">{`${average_service_time.days.toFixed(
                2
              )} "day(s)," average_service_time.hours.toFixed(2) "hours"}`}</h2>
              <Link to="/admin/service-times" className="edit-btn">
                Details
              </Link>
            </div>
            <div className="text-center shadow-md shadow-[#555] p-[2rem] rounded-[1rem] flex flex-col gap-[1rem]">
              <h2 className="text-khamco-secondary text-2xl font-bold">
                Invoice Data
              </h2>
              <h2 className="text-green-500">{`${
                invoice_data.length ? invoice_data[0].total : 0
              } "created"}`}</h2>
              <h2 className="text-green-500">{`${
                invoice_data.length ? invoice_data[0].sum : 0
              } "deleted"}`}</h2>
              <Link to="/admin/invoice_data" className="edit-btn">
                Details
              </Link>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default AdminDashboard;
